import CanvasDraw from 'react-canvas-draw'

function App() {

  return (
    <div className="container">
        <h1>
          Welcome to Quick Draw!
        </h1>
        <CanvasDraw 
          className='canvas'
          onChange=''
          hideGrid={true}
          brushRadius={2}
          lazyRadius={0}
        />
    </div>
  );
}

export default App;
